import React from 'react';

function PlayerProfile({ leaderboardData }) {
  // Split the leaderboard data into two halves
  const midIndex = Math.ceil(leaderboardData.length / 2);
  const leftLeaderboard = leaderboardData.slice(0, midIndex);
  const rightLeaderboard = leaderboardData.slice(midIndex);

  return (
    <div className="leaderboard-container">
      {/* Left Column */}
      <div className="leaderboard-column">
        <h3>Leaderboard (1 - {midIndex})</h3>
        <ul>
          {leftLeaderboard.map((player, index) => (
            <li key={player.summoner_name} className="leaderboard-item">
              <strong>{index + 1}.</strong> {player.summoner_name}: {player.average_score.toFixed(2)} points
            </li>
          ))}
        </ul>
      </div>

      {/* Right Column */}
      <div className="leaderboard-column">
        <h3>Leaderboard ({midIndex + 1} - {leaderboardData.length})</h3>
        <ul>
          {rightLeaderboard.map((player, index) => (
            <li key={player.summoner_name} className="leaderboard-item">
              <strong>{midIndex + index + 1}.</strong> {player.summoner_name}: {player.average_score.toFixed(2)} points
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default PlayerProfile;
